# Parse the output
pattern = r'(\d+)/828.*?AbsRel: ([\d.e+-]+).*?SqRel: ([\d.e+-]+).*?RMSE: ([\d.e+-]+).*?RMSE_log: ([\d.e+-]+).*?Delta1: ([\d.]+).*?Delta2: ([\d.]+).*?Delta3: ([\d.]+)'

matches = re.findall(pattern, output_text)

# Extract data
samples = []
abs_rel = []
sq_rel = []
rmse = []
rmse_log = []
delta1 = []
delta2 = []
delta3 = []

for match in matches:
    samples.append(int(match[0]))
    abs_rel.append(float(match[1]))
    sq_rel.append(float(match[2]))
    rmse.append(float(match[3]))
    rmse_log.append(float(match[4]))
    delta1.append(float(match[5]))
    delta2.append(float(match[6]))
    delta3.append(float(match[7]))

print(f"Parsed {len(samples)} data points")
print(f"Final metrics:")
print(f"  AbsRel: {abs_rel[-1]:.4f}")
print(f"  RMSE: {rmse[-1]:.4f} m")
print(f"  Delta1: {delta1[-1]*100:.2f}%")

# Create plots
fig, axes = plt.subplots(2, 2, figsize=(14, 10))
fig.suptitle('M4Depth Evaluation Metrics on UseGeo Dataset (Pretrained Model)', 
             fontsize=16, fontweight='bold')

# Plot 1: Error Metrics
ax1 = axes[0, 0]
ax1.plot(samples, abs_rel, 'b-', linewidth=2, label='Abs Rel')
ax1.set_xlabel('Sample Number', fontsize=12)
ax1.set_ylabel('Absolute Relative Error', fontsize=12)
ax1.set_title('Absolute Relative Error Over Evaluation', fontsize=14, fontweight='bold')
ax1.grid(True, alpha=0.3)
ax1.legend(fontsize=10)
ax1.set_ylim(bottom=0)

# Plot 2: RMSE
ax2 = axes[0, 1]
ax2.plot(samples, rmse, 'r-', linewidth=2, label='RMSE')
ax2.plot(samples, rmse_log, 'orange', linewidth=2, label='RMSE log')
ax2.set_xlabel('Sample Number', fontsize=12)
ax2.set_ylabel('RMSE (meters)', fontsize=12)
ax2.set_title('Root Mean Squared Error Over Evaluation', fontsize=14, fontweight='bold')
ax2.grid(True, alpha=0.3)
ax2.legend(fontsize=10)
ax2.set_ylim(bottom=0)

# Plot 3: Squared Relative Error
ax3 = axes[1, 0]
ax3.plot(samples, sq_rel, 'g-', linewidth=2, label='Sq Rel')
ax3.set_xlabel('Sample Number', fontsize=12)
ax3.set_ylabel('Squared Relative Error', fontsize=12)
ax3.set_title('Squared Relative Error Over Evaluation', fontsize=14, fontweight='bold')
ax3.grid(True, alpha=0.3)
ax3.legend(fontsize=10)
ax3.set_ylim(bottom=0)

# Plot 4: Delta Accuracy Metrics
ax4 = axes[1, 1]
ax4.plot(samples, [d*100 for d in delta1], 'purple', linewidth=2, label=' < 1.25')
ax4.plot(samples, [d*100 for d in delta2], 'cyan', linewidth=2, label=' < 1.25')
ax4.plot(samples, [d*100 for d in delta3], 'magenta', linewidth=2, label=' < 1.25')
ax4.set_xlabel('Sample Number', fontsize=12)
ax4.set_ylabel('Accuracy (%)', fontsize=12)
ax4.set_title('Threshold Accuracy Metrics Over Evaluation', fontsize=14, fontweight='bold')
ax4.grid(True, alpha=0.3)
ax4.legend(fontsize=10)
ax4.set_ylim([95, 101])  # Focus on high accuracy range

# Add final values as text
final_text = f"""Final Metrics (828 samples):
- Abs Rel: {abs_rel[-1]:.4f}
- Sq Rel: {sq_rel[-1]:.4f}
- RMSE: {rmse[-1]:.3f} m
- RMSE log: {rmse_log[-1]:.4f}
-  < 1.25: {delta1[-1]*100:.2f}%
-  < 1.25: {delta2[-1]*100:.2f}%
-  < 1.25: {delta3[-1]*100:.2f}%"""

fig.text(0.5, 0.02, final_text, ha='center', fontsize=11, 
         bbox=dict(boxstyle='round', facecolor='wheat', alpha=0.5))

plt.tight_layout(rect=[0, 0.08, 1, 0.96])

